⚠️ It doesn't work with IE11.
@default false

TablePagination.ActionsComponent:
The component used for displaying the actions.
Either a string to use a HTML element or a component.
@default TablePaginationActions

TablePagination.getItemAriaLabel:
Accepts a function which returns a string value that provides a user-friendly name for the current page.

For localization purposes, you can use the provided [translations](/guides/localization/).

@param {string} type The link or button type to format ('first' | 'last' | 'next' | 'previous').
@returns {string}
@default function defaultGetAriaLabel(type) {
  return `Go to ${type} page`;
}

TablePagination.labelDisplayedRows:
Customize the displayed rows label. Invoked with a `{ from, to, count, page }`
object.

For localization purposes, you can use the provided [translations](/guides/localization/).
@default function defaultLabelDisplayedRows({ from, to, count }) {
  return `${from}-${to} of ${count !== -1 ? count : `more than ${to}`}`;
}

TablePagination.labelRowsPerPage:
Customize the rows per page label.

For localization purposes, you can use the provided [translations](/guides/localization/).
@default 'Rows per page:'

TablePagination.onPageChange:
Callback fired when the page is changed.

@param {object} event The event source of the callback.
@param {number} page The page selected.

TablePagination.rowsPerPageOptions:
Customizes the options of the rows per page select field. If less than two options are
available, no select field will be displayed.
@default [10, 25, 50, 100]

Tabs.allowScrollButtonsMobile:
If `true`, the scroll buttons aren't forced hidden on mobile.
By default the scroll buttons are hidden on mobile and takes precedence over `scrollButtons`.
@default false

Tabs.centered:
If `true`, the tabs will be centered.
This prop is intended for large views.
@default false

Tabs.onChange:
Callback fired when the value changes.

@param {object} event The event source of the callback. **Warning**: This is a generic event not a change event.
@param {any} value We default to the index of the child (number)

Tabs.visibleScrollbar:
If `true`, the scrollbar will be visible. It can be useful when displaying
a long vertical list of tabs.
@default false

TextField.onChange:
Callback fired when the value is changed.

@param {object} event The event source of the callback.
You can pull out the new value by accessing `event.target.value` (string).

TextField.select:
Render a [`Select`](/api/select/) element while passing the Input element to `Select` as `input` parameter.
If this option is set you must pass the options of the select as children.
@default false

ToggleButton.size:
The size of the button.
The prop defaults to the value inherited from the parent ToggleButtonGroup component.
@default 'medium'

ToggleButtonGroup.onChange:
Callback fired when the value changes.

@param {object} event The event source of the callback.
@param {any} value of the selected buttons. When `exclusive` is true
this is a single value; when false an array of selected values. If no value
is selected and `exclusive` is true the value is null; when false an empty array.

Tooltip.describeChild:
Set to `true` if the `title` acts as an accessible description.
By default the `title` acts as an accessible label for the child.
@default false

Tooltip.disableInteractive:
Makes a tooltip not interactive, i.e. it will close when the user
hovers over the tooltip before the `leaveDelay` is expired.
@default false

Tooltip.enterDelay:
The number of milliseconds to wait before showing the tooltip.
This prop won't impact the enter touch delay (`enterTouchDelay`).
@default 100

Tooltip.leaveDelay:
The number of milliseconds to wait before hiding the tooltip.
This prop won't impact the leave touch delay (`leaveTouchDelay`).
@default 0

Tooltip.TransitionComponent:
The component used for the transition.
[Follow this guide](/components/transitions/#transitioncomponent-prop) to learn more about the requirements for this component.
@default Grow

TreeItem.TransitionComponent:
The component used for the transition.
[Follow this guide](/components/transitions/#transitioncomponent-prop) to learn more about the requirements for this component.
@default Collapse

TreeView.defaultSelected:
Selected node ids. (Uncontrolled)
When `multiSelect` is true this takes an array of strings; when false (default) a string.
@default []

TreeView.onNodeFocus:
Callback fired when tree items are focused.

@param {object} event The event source of the callback **Warning**: This is a generic event not a focus event.
@param {string} value of the focused node.

TreeView.onNodeSelect:
Callback fired when tree items are selected/unselected.

@param {object} event The event source of the callback
@param {(array|string)} value of the selected nodes. When `multiSelect` is true
this is an array of strings; when false (default) a string.

TreeView.onNodeToggle:
Callback fired when tree items are expanded/collapsed.

@param {object} event The event source of the callback.
@param {array} nodeIds The ids of the expanded nodes.

Unstable_TrapFocus.disableRestoreFocus:
If `true`, the trap focus will not restore focus to previously focused element once
trap focus is hidden.
@default false

Zoom.timeout:
The duration for the transition, in milliseconds.
You may specify a single timeout for all transitions, or individually with an object.
@default {
  enter: duration.enteringScreen,
  exit: duration.leavingScreen,
}
